import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Todo from './components/Todo';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path='/' component={<Todo />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
